import React from "react";


const Contact = () => {



    return (
        <div className="contact-wrapper">
            <div className="Contact">
                <p>Contact</p>
                <div>Email: DavidJHennig@gmail.com</div>
                <br />
                <div>LinkedIn: https://www.linkedin.com/in/davidhennig/</div>
                <br />
                <div>Github: https://github.com/davidhennig</div>
            </div>
        </div>
    )
}

export default Contact;
